@jamde5201,

It is taking me a long time to get a full copy, but I'm going to seed for a day once I get it.  Seeding isn't a function of the quality, it's a function of gratitude and a desire to give back.

Of course, I'm also seeding the parts that I have, since that's how torrent clients work.  A true leecher would be someone who throttles their upload bandwidth intentionally.
